    false,nt"url": null,nt"notes": "This annual narrative report for Sherburne
    National Wildlife Refuge summarizes Refuge activities during the 1994 calendar year.
    The report begins with a summary of the yearu2019s highlights and climatic conditions.
    The report includes a planning section which discusses research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered. Subjects include wetlands, forests,
    grasslands, fire management, pest control, and private lands. The wildlife section
    of the report discusses endangered species, threatened species, waterfowl, marsh
    birds, waterbirds, game mammals, scientific collections, animal control, marking,
    banding, and disease control. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, and
    law enforcement. The equipment and facilities section of the report provides information
    about rehabilitation, major maintenance, equipment utilization/replacement, and
    computer systems. Cooperative programs are provided at the end.",nt"owner_org":
